import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import './Projectblock.css'

function Projectblock(props) {
    let param = useParams()
    let [systemarr, setsystemarr] = useState({data:[]})
    let [systemarr2, setsystemarr2] = useState({data:[]})
    let [filter1, setfilter1] = useState([])
    let [filter2, setfilter2] = useState([])

    let [count, setcount] = useState(11)
    let [page, setpage] = useState(0)
    let langarr
    let arry = [];

    useEffect(()=>{

      langarr = param.count.split("-")

    },[param.count])

    useEffect(()=>{

      rendernormal()
    },[])

    useEffect(()=>{

      rerenderprods2()
    },[count])
    useEffect(()=>{

      rerenderprods2()
    },[systemarr])

    function rendernormal(){
      fetch('https://squid-app-9h43v.ondigitalocean.app/api/'+langarr[0]+'-projects')
      .then(res=>res.json())
      .then(json=>{setsystemarr(json)}).then(()=>rerenderprods2())
    }
    
   function rerenderprods2(attrib,idd){
    if(systemarr.data.length > 0){



    for (let i = 0; i < count; i++) {

      try{    
        if(systemarr.data[i]){arry.push(systemarr.data[i])}
        }
      catch{}
  
    }
    
    let imv = {data:[page,arry]}
    console.log(imv)
    setsystemarr2(imv)
    }else{console.log("not yet")}

   }
   function loadsystem(prop){
    console.log(prop)
    let systemurl = "/"+param.count+"/projects/"+prop
    window.location.replace(systemurl)
   }


   function rerendering(){
    if(systemarr2.data.length > 0){
      return(
        <>
        {
        systemarr2.data[1].map((statss, index) => (
          <>
          {
            returncards(index, statss)
          }

          </>
           ))
          }
          </>
      )
    }else{
      return(
        <>
        </>
      )

    }
   }

   function returncards(index, statss){
    switch(index) {
      case index %12 == 0:
        return (
          <>
            <div className='Projects-image-card-gross' >
              <a href={"#"} alt="projectlink" onClick={()=>loadsystem("statss.attributes.titel1")}>
              <img src={statss.attributes.image1} />
              </a>
            </div>
          </>
        );
        case index %12 == 1:
          return (
            <>
